import axios from "axios";
import React, { useState } from "react";

function Signin({ setOtpModalOpen, setEmail }) {
    const [credential, setCredential] = useState("email"); // Default to email
    const [formData, setFormData] = useState({
        email: "",
        username: "",
        password: "",
        agreeToTerms: false, // Include this in your form data
    });

    const handleChange = (event) => {
        const { name, value, type, checked } = event.target;
        setFormData((prevData) => ({
            ...prevData,
            [name]: type === "checkbox" ? checked : value,
        }));
    };

    const handleCredentialChange = (e) => setCredential(e.target.value); // Update credential

    const handleSubmit = async (event) => {
        event.preventDefault();
        try {
            setEmail(credential === "email" ? formData.email : formData.username); // Set email or username based on selection
            const response = await axios.post(
                "http://127.0.0.1:8000/signup/",
                {
                    email: credential === "email" ? formData.email : "",
                    username: credential === "username" ? formData.username : "",
                    password: formData.password,
                    agreeToTerms: formData.agreeToTerms,
                },
                { withCredentials: true }
            );
            console.log("Signup successful:", response.data);
            alert(response.data.message);
            setOtpModalOpen(true);
        } catch (error) {
            console.error(error.response?.data?.message);
            let error_message = "";
            if (error.response?.data) {
                const errorData = error.response.data.errors; // Assuming your API returns errors in this structure
                for (let key in errorData) {
                    if (Array.isArray(errorData[key])) {
                        error_message += `${errorData[key].join(", ")}\n`;
                    }
                }
            } else {
                error_message = "An error occurred during signup.";
            }
            alert(error_message);
        }
    };

    return (
        <div className="col container custom_signin">
            <form className="row g-3" onSubmit={handleSubmit}>
                <div className="col-12">
                    <div className="form-label d-flex">
                        <div className="form-check text-start fw-bold ms-5">
                            <input
                                className="form-check-input border"
                                type="radio"
                                name="credential"
                                value="email"
                                checked={credential === "email"}
                                onChange={handleCredentialChange}
                                required
                            />
                            <label className="form-check-label text-start">
                                Email
                            </label>
                        </div>
                        <div className="form-check text-start fw-bold">
                            <input
                                className="form-check-input border"
                                type="radio"
                                name="credential"
                                value="username"
                                checked={credential === "username"}
                                onChange={handleCredentialChange}
                                required
                            />
                            <label className="form-check-label text-start">
                                Username
                            </label>
                        </div>
                    </div>
                    {credential === "email" ? (
                        <input
                            type="email"
                            name="email"
                            className="form-control"
                            placeholder="Enter email"
                            required
                            value={formData.email}
                            onChange={handleChange}
                        />
                    ) : (
                        <input
                            type="text"
                            name="username"
                            className="form-control"
                            placeholder="Enter username"
                            required
                            value={formData.username}
                            onChange={handleChange}
                        />
                    )}
                </div>
                <div className="col-12">
                    <div className="form-label text-end fw-bold">Password</div>
                    <input
                        type="password"
                        name="password"
                        className="form-control"
                        required
                        value={formData.password}
                        onChange={handleChange}
                    />
                </div>
                <div className="col-12">
                    <div className="form-check text-start fw-bold">
                        <input
                            className="form-check-input border"
                            type="checkbox"
                            name="agreeToTerms"
                            required
                            checked={formData.agreeToTerms}
                            onChange={handleChange}
                        />
                        <label className="form-check-label text-start">
                            I agree
                        </label>
                    </div>
                </div>
                <div className="col-12 text-start">
                    <button type="submit" className="btn btn-primary col-12">
                        Sign in
                    </button>
                </div>
            </form>
        </div>
    );
}

export default Signin;
